import React from 'react';

import NavSearch from '../navSection/NavSearch';

function Product() {
  return (
    <div>
      <NavSearch />
      <>
        <div className='product'>
          <img src={''} alt="" />
        </div>
      </>
    </div>
  );
}

export default Product;
